import React from 'react';
import {MDXProvider} from '@mdx-js/react';

const components = {
  wrapper: props => {
    <div >
      <main {...props}/>
    </div>
  }
}

const MDX = (props) => {
  console.log({props})
  return (
    <MDXProvider components={components}>
      <main {...props}/>
    </MDXProvider>
  )
}

export default MDX
